local saved = {}

local shader = dxCreateShader([[
texture Tex0;

technique simple
{
    pass P0
    {
        Texture[0] = Tex0;
    }
}
]])

function table.includes(tbl, value)
    for _, v in ipairs(tbl) do
        if v == value then
            return true
        end
    end
    return false
end

local rt = dxCreateRenderTarget(15, 15)
dxSetRenderTarget(rt)
dxDrawRectangle(0, 0, 15, 15, 0xFF00FF00)
dxSetRenderTarget()
dxSetShaderValue(shader, 'Tex0', rt)

bindKey('L', 'down', function()
    local x, y, z = getElementPosition(localPlayer)
    local objects = getElementsWithinRange(x, y, z, 25, 'object')
    for k,v in pairs(objects) do
        if not table.includes(saved, v) then
            engineApplyShaderToWorldTexture(shader, '*', v)
            table.insert(saved, v)
        end
    end
end)

bindKey('K', 'down', function()
    local x, y, z = getElementPosition(localPlayer)
    local objects = getElementsWithinRange(x, y, z, 25, 'object')
    -- remove objects and remove shader
    for k,v in pairs(objects) do
        engineRemoveShaderFromWorldTexture(shader, '*', v)
        for d,c in pairs(saved) do
            if c == v then
                table.remove(saved, d)
            end
        end
    end
end)

addCommandHandler('saveobj', function()
    local c = ''
    for k,v in pairs(saved) do
        local model = getElementModel(v)
        local x, y, z = getElementPosition(v)
        local rx, ry, rz = getElementRotation(v)
        c = c .. ('createObject(%d, %f, %f, %f, %f, %f, %f)\n'):format(model ,x ,y, z, rx, ry, rz)
    end
    setClipboard(c)
end)